const App = () => {
  const [loading, setLoading] = useState(false);
  const [getContacts, setContacts] = useState([]);
  return (
    <div className="App">
      <Navbar />
      <Routes>
        <Route path="/" element={<Navigate to="/contacts" />} />
        <Route path="/contacts"
        element={<Contacts/>}/>
      </Routes>
      {/* <Contacts contacts={getContacts} loading={loading} /> */}
    </div>
  );
};

export default App;
